    const [dailyData ,setDailyData] =useState([]);
    
    const fetchedAPI = async ()=>await fetchCountries()
    
    
    
    return(
    <div className={styles.formControl}>
        <FormControl>
            <NativeSelect>
                <option value='global'>Global</option>
            </NativeSelect>
        </FormControl>
    </div>
)
}

